import React from 'react'
import data from './data'
import "./menu.css"
import GenerateColor from './generator_color'
import { useEffect } from 'react'

const Menu = () => {
   const {color, generatoColor} = GenerateColor()

useEffect(()=>{
    generatoColor
})
  return (
    <div className='menu'>
      {
          data.map((onedata,index)=>{
            const {name_folder,id} = onedata
            return<div key={id}>
              <button style={{backgroundColor:"#"+color }} className='btn'>{name_folder}</button>
            </div>
          })
        }
        <button className='add'>Add</button>
    </div>
  )
}

export default Menu
